  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Fish and Wildlife Service (Service)
  has explored the potential to improve and expand the existing irrigation system
  to increase forage production on the National Elk Refuge (Refuge), that is located
  in Teton County, Wyoming, north of the Town of Jackson and south of Grand Teton
  National Park. By expanding the irrigation system it is anticipated that there will
  be a reduction on the reliance for supplemental winter feeding, which is a primary
  management strategy identified in the 2007 Bison and Elk Management Plan/Environmental
  Impact Statement (Plan/EIS). Water resources will be utilized more efficiently.
  More water will be available to support Flat Creek fisheries resources and riparian
  habitat growth. Forage production will increase over an expanded area, increasing
  dispersal of elk and bison, thus reducing the opportunity to transmit diseases between
  animals. In addition to increasing the production of grazing forage by expanding
  the use of irrigation, decreasing the bison and elk herd size through hunting and
  achieving population management goals is vital. Inadequate forage production has
  contributed to the need to artificially feed elk during the winter for 87 of the
  last 96 years.  This environmental assessment discusses the final plan and preferred
  alternative and the affected environment.  Maps of the vicinity and management units
  are included.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
